import axios from "axios";
import HamburgerMenu from "../components/HamburgerMenu";
import PhotoGrid from "../components/PhotoGrid";
import { useEffect, useState } from "react";

const Home = () => {
    const [photo, setPhoto] = useState();
    useEffect(() => {
        const fetchPhoto = () => {
            axios
                .get(
                    `https://api.unsplash.com/photos/random?query=sky&client_id=sWZdNezChJpcagD8SZzmCw42Ifnad7XS6cyaB4Nsm6Q`
                )
                .then((res) => {
                    setPhoto(res.data);
                    console.log(res.data);
                });
        };
        fetchPhoto();
    }, []);
    const samplePhotos = [
        "https://plus.unsplash.com/premium_photo-1680742443429-29c93d33138a?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MXx8JUU3JUE5JUJBfGVufDB8fDB8fHww",
        "https://plus.unsplash.com/premium_photo-1680742443429-29c93d33138a?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MXx8JUU3JUE5JUJBfGVufDB8fDB8fHww",
        "https://plus.unsplash.com/premium_photo-1680742443429-29c93d33138a?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MXx8JUU3JUE5JUJBfGVufDB8fDB8fHww",
        "https://plus.unsplash.com/premium_photo-1680742443429-29c93d33138a?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MXx8JUU3JUE5JUJBfGVufDB8fDB8fHww",
        "https://plus.unsplash.com/premium_photo-1680742443429-29c93d33138a?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MXx8JUU3JUE5JUJBfGVufDB8fDB8fHww",
        "https://plus.unsplash.com/premium_photo-1680742443429-29c93d33138a?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8MXx8JUU3JUE5JUJBfGVufDB8fDB8fHww",
    ];

    return (
        <div className="app-container">
            <div className="sidebar">
                <HamburgerMenu menu1="MyPage" menu2="Logout" />
            </div>
            <div className="content">
                <PhotoGrid photo={photo} />
            </div>
        </div>
    );
};
export default Home;
